INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106001, 7001, 1, "キャル", "2030/12/17 14:59:59", -363.0, 1, 0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 0, 7, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105901, 7002, 1, "コッコロ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 0, 7, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105801, 7003, 1, "ペコリーヌ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 0, 7, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105801, 10001, 1, "ペコリーヌ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 0, 10, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106001, 10002, 1, "キャル", "2030/12/17 14:59:59", -363.0, 1, 0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 0, 10, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105901, 10003, 1, "コッコロ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 0, 10, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106401, 10004, 1, "シェフィ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2, 0, 10, 0.0, "2015/12/17 15:00:00", 2104010);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105801, 12001, 1, "ペコリーヌ", "2030/12/17 14:59:59", -416.5, 1, 0.0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 0, 12, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106001, 13001, 1, "キャル", "2030/12/17 14:59:59", -363.0, 1, 0.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 0, 13, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105901, 13002, 1, "コッコロ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 0, 13, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106401, 13003, 1, "シェフィ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2, 0, 13, 0.0, "2015/12/17 15:00:00", 2104010);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105801, 13004, 1, "ペコリーヌ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 0, 13, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105901, 14001, 1, "コッコロ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 0, 14, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106401, 14002, 1, "シェフィ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2, 0, 14, 0.0, "2015/12/17 15:00:00", 2104010);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105801, 14003, 1, "ペコリーヌ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 0, 14, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106001, 14004, 1, "キャル", "2030/12/17 14:59:59", -363.0, 1, 0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 0, 14, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105901, 15001, 1, "コッコロ", "2030/12/17 14:59:59", -470.0, 1, 0.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 0, 15, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106401, 16001, 1, "シェフィ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2, 0, 16, 0.0, "2015/12/17 15:00:00", 2104010);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105801, 16002, 1, "ペコリーヌ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 0, 16, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106001, 16003, 1, "キャル", "2030/12/17 14:59:59", -363.0, 1, 0.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 0, 16, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105901, 16004, 1, "コッコロ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 0, 16, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105901, 17002, 1, "コッコロ", "2030/12/17 14:59:59", -363.0, 1, 0.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 0, 17, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106001, 17004, 1, "キャル", "2030/12/17 14:59:59", -363.0, 1, 0.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 0, 25, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105901, 17005, 1, "コッコロ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 0, 25, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106401, 17006, 1, "シェフィ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2, 0, 25, 0.0, "2015/12/17 15:00:00", 2104010);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105801, 17007, 1, "ペコリーヌ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 0, 25, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (190801, 18001, 1, "カリン", "2030/12/17 14:59:59", -363.0, 1, 0.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 0, 18, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (190801, 18002, 1, "カリン", "2030/12/17 14:59:59", -363.0, 2, 0.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 1, 0, 18, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (190801, 19001, 1, "カリン", "2030/12/17 14:59:59", -470.0, 3, 0.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 1, 0, 19, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (190801, 19002, 1, "カリン", "2030/12/17 14:59:59", -470.0, 4, 0.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, 0, 19, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (190801, 20001, 1, "カリン", "2030/12/17 14:59:59", -470.0, 5, 0.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, 0, 20, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (190801, 20002, 1, "カリン", "2030/12/17 14:59:59", -470.0, 6, 0.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, 0, 20, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106001, 21001, 1, "キャル", "2030/12/17 14:59:59", -363.0, 1, 0.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 0, 21, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105901, 21002, 1, "コッコロ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 0, 21, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106401, 21003, 1, "シェフィ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2, 0, 21, 0.0, "2015/12/17 15:00:00", 2104010);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105801, 21004, 1, "ペコリーヌ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 0, 21, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (190801, 22001, 1, "カリン", "2030/12/17 14:59:59", -430.0, 1, 0.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 0, 22, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (190801, 22002, 1, "カリン", "2030/12/17 14:59:59", -430.0, 2, 0.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, 0, 22, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (190801, 23001, 1, "カリン", "2030/12/17 14:59:59", -430.0, 3, 0.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, 0, 23, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (190801, 23002, 1, "カリン", "2030/12/17 14:59:59", -430.0, 4, 0.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, 0, 23, 0.0, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109001, 24001, 2, "エリコ（バレンタイン）", "2030/12/17 14:59:59", -385.0, 1, 4.08, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, 10011, 24, 8.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109001, 24002, 2, "エリコ（バレンタイン）", "2030/12/17 14:59:59", -385.0, 2, 5.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 1, 10011, 24, 8.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109001, 24003, 2, "エリコ（バレンタイン）", "2030/12/17 14:59:59", -385.0, 3, 10.11, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 1, 10011, 24, 8.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109001, 24004, 2, "エリコ（バレンタイン）", "2030/12/17 14:59:59", -385.0, 4, 4.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 1, 10011, 24, 8.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109001, 24005, 2, "エリコ（バレンタイン）", "2030/12/17 14:59:59", -385.0, 5, 6.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 1, 10011, 24, 8.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109002, 24006, 1, "エリコ（バレンタイン）", "2030/12/17 14:59:59", 0.0, 6, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, 10011, 24, 0.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109002, 24007, 1, "エリコ（バレンタイン）", "2030/12/17 14:59:59", 0.0, 7, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, 10011, 24, 0.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109002, 24008, 1, "エリコ（バレンタイン）", "2030/12/17 14:59:59", 0.0, 8, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, 10011, 24, 0.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109002, 24009, 1, "エリコ（バレンタイン）", "2030/12/17 14:59:59", 0.0, 9, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, 10011, 24, 0.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109002, 24010, 1, "エリコ（バレンタイン）", "2030/12/17 14:59:59", 0.0, 10, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, 10011, 24, 0.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109101, 24011, 2, "シズル（バレンタイン）", "2030/12/17 14:59:59", -385.0, 1, 2.12, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, 10011, 24, 8.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109101, 24012, 2, "シズル（バレンタイン）", "2030/12/17 14:59:59", -385.0, 2, 4.19, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 5, 10011, 24, 8.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109101, 24013, 4, "シズル（バレンタイン）", "2030/12/17 14:59:59", -385.0, 3, 2.3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2, 10011, 24, 8.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109102, 24014, 1, "シズル（バレンタイン）", "2030/12/17 14:59:59", 0.0, 4, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, 10011, 24, 0.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109101, 24015, 2, "シズル（バレンタイン）", "2030/12/17 14:59:59", -385.0, 5, 5.23, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, 10011, 24, 8.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109102, 24016, 1, "シズル（バレンタイン）", "2030/12/17 14:59:59", 0.0, 6, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, 10011, 24, 0.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109101, 24017, 2, "シズル（バレンタイン）", "2030/12/17 14:59:59", -385.0, 7, 5.01, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 1, 10011, 24, 8.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109102, 24018, 1, "シズル（バレンタイン）", "2030/12/17 14:59:59", 0.0, 8, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, 10011, 24, 0.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109102, 24019, 1, "シズル（バレンタイン）", "2030/12/17 14:59:59", 0.0, 9, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, 10011, 24, 0.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109102, 24020, 1, "シズル（バレンタイン）", "2030/12/17 14:59:59", 0.0, 10, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, 10011, 24, 0.0, "2019/01/31 12:00:00", 0);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (106401, 26001, 1, "シェフィ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 2, 0, 26, 0.0, "2015/12/17 15:00:00", 2104010);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105801, 26002, 1, "ペコリーヌ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 1, 0, 26, 0.0, "2015/12/17 15:00:00", 0);
