INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (105801, 27002, 1, "ペコリーヌ", "2030/12/17 14:59:59", -363.0, 1, 0.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 1, 0, 27, 0.0, "2015/12/17 15:00:00", 0);
