INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (123001, 43004, 1, "アメス", "2030/12/17 14:59:59", -416.5, 1, 0.0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 1, 0, 44, 0.0, "2015/12/17 15:00:00", 0);
